// App.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import RestaurantSearch from './components/RestaurantSearch'; // Changed to RestaurantSearch
import RestaurantDetails from './components/RestaurantDetails';
import AddRestaurant from './components/AddRestaurant';
import RestaurantList from './components/RestaurantList'; // Import RestaurantList
import './App.css';

function App() {
  return (
    <Router>
      <div className="app-container">
        <header className="app-header">
          <h1>Find Your Best Local Food</h1>
          <nav>
            <Link to="/">Search Restaurants</Link>
            <Link to="/list">All Restaurants</Link> {/* Added Link to RestaurantList */}
            <Link to="/add">Add Restaurant</Link>
          </nav>
        </header>
        <main className="app-content">
          <Routes>
            <Route path="/" element={<RestaurantSearch />} />
            <Route path="/restaurant/:id" element={<RestaurantDetails />} />
            <Route path="/add" element={<AddRestaurant />} />
            <Route path="/list" element={<RestaurantList />} /> {/* Added Route for RestaurantList */}
          </Routes>
        </main>
      </div>
    </Router>
  );
}

export default App;
